const wecken = {
  primary: {
    darkNavy: "#0B0B3A",
    linkBlue: "#347EED",
  },
  black: {
    100: "#000",
    medium: "#828282",
    20: "#BDBDBD",
    10: "#E0E0E0",
    overlay96: "rgba(62, 58, 55, .96)",
    overlay56: "rgba(62, 58, 55, .56)",
    elevationShadow: "rgba(30, 28, 26, .12)",
  },
  white: {
    high: "#fff",
  },
} as const

const status = {
  green: {
    success: "#1ECE4F",
  },
  red: {
    attention: "#FB7070",
    danger: "#DE6150",
  },
  yellow: {
    alert: "#FFB800",
  },
} as const

export const palette = {
  wecken,
  status,
}
